INSERT INTO `v1_4d47e39d8b0da87d25d2f1f945773e8d304deed418bcb645043830d50bd33ef1` VALUES (1000, "調子が上がって\nきたなっ", 2, "vo_minigame_1013_icon_2_002_001", 3000, 2, "vo_minigame_1013_icon_1_002_001", 1, "訓練はまだ\nここからですわ", 2);
INSERT INTO `v1_4d47e39d8b0da87d25d2f1f945773e8d304deed418bcb645043830d50bd33ef1` VALUES (5000, "ほらほら、\nまだいけるだろ？", 2, "vo_minigame_1013_icon_2_003_001", 3000, 2, "vo_minigame_1013_icon_1_003_001", 2, "クスクス、悪くない\n流れですわね", 2);
INSERT INTO `v1_4d47e39d8b0da87d25d2f1f945773e8d304deed418bcb645043830d50bd33ef1` VALUES (10000, "へへっ、おまえら\nやるじゃねえか！", 2, "vo_minigame_1013_icon_2_004_001", 3000, 2, "vo_minigame_1013_icon_1_004_001", 3, "すばらしい\n記録ですわ", 3);
INSERT INTO `v1_4d47e39d8b0da87d25d2f1f945773e8d304deed418bcb645043830d50bd33ef1` VALUES (10000, "あたしたちはまだ\n止まらねえぜ！", 2, "vo_minigame_1013_icon_2_005_001", 3000, 3, "vo_minigame_1013_icon_1_005_001", 4, "乗りに乗って\nいますわね", 3);
INSERT INTO `v1_4d47e39d8b0da87d25d2f1f945773e8d304deed418bcb645043830d50bd33ef1` VALUES (10000, "見てろよ！\nマコト班の快進撃だ！", 2, "vo_minigame_1013_icon_2_005_002", 3000, 3, "vo_minigame_1013_icon_1_005_002", 5, "まだまだ行きます\nついてきなさい", 3);
INSERT INTO `v1_4d47e39d8b0da87d25d2f1f945773e8d304deed418bcb645043830d50bd33ef1` VALUES (10000, "うおぉぉっ！\n絶好調だぜ！", 2, "vo_minigame_1013_icon_2_005_003", 3000, 3, "vo_minigame_1013_icon_1_005_003", 6, "エリコ班の\n本領発揮ですわ！", 3);
INSERT INTO `v1_4d47e39d8b0da87d25d2f1f945773e8d304deed418bcb645043830d50bd33ef1` VALUES (0, "どこまで行けるか\n楽しみだなっ！", 2, "vo_minigame_1013_icon_2_006_001", 3000, 4, "vo_minigame_1013_icon_1_006_001", 7, "ここからは\n前人未到の領域です！", 3);
INSERT INTO `v1_4d47e39d8b0da87d25d2f1f945773e8d304deed418bcb645043830d50bd33ef1` VALUES (1, "まだ諦めんなよっ", 3, "vo_minigame_1013_icon_2_007_001", 1000, 5, "vo_minigame_1013_icon_1_007_001", 8, "厄介でしたわ…", 4);
INSERT INTO `v1_4d47e39d8b0da87d25d2f1f945773e8d304deed418bcb645043830d50bd33ef1` VALUES (1, "冷やっとしたぜ…！", 3, "vo_minigame_1013_icon_2_007_002", 1000, 5, "vo_minigame_1013_icon_1_007_002", 9, "油断大敵です", 4);
INSERT INTO `v1_4d47e39d8b0da87d25d2f1f945773e8d304deed418bcb645043830d50bd33ef1` VALUES (1, "弱音を吐くなっ", 3, "vo_minigame_1013_icon_2_007_003", 1000, 5, "vo_minigame_1013_icon_1_007_003", 10, "忌々しいっ…", 4);
INSERT INTO `v1_4d47e39d8b0da87d25d2f1f945773e8d304deed418bcb645043830d50bd33ef1` VALUES (99, "マコト班集合！", 4, "vo_minigame_1013_icon_2_008_001", 1500, 6, "vo_minigame_1013_icon_1_008_001", 11, "大所帯ですわね", 3);
INSERT INTO `v1_4d47e39d8b0da87d25d2f1f945773e8d304deed418bcb645043830d50bd33ef1` VALUES (99, "連携してくぞ！", 4, "vo_minigame_1013_icon_2_008_002", 1500, 6, "vo_minigame_1013_icon_1_008_002", 12, "エリコ班へようこそ", 3);
INSERT INTO `v1_4d47e39d8b0da87d25d2f1f945773e8d304deed418bcb645043830d50bd33ef1` VALUES (0, "みんなに力を！", 1, "vo_minigame_1013_icon_2_020_001", 3000, 8, "vo_minigame_1013_icon_1_020_001", 13, "ナナカちゃんに\nお任せあれ", 6);
